data class VirtualElementCallWidgetOptions (
    /**
     * The url to the app.
     *
     * E.g. <https://call.element.io>, <https://call.element.dev>
     */
    var `elementCallUrl`: kotlin.String, 
    /**
     * The widget id.
     */
